import Navbar from "./components/Navbar";
import About from "./components/About";
import Work from "./components/Work";
import Me from "./components/Me";
import Footer from "./components/Footer";
import React from "react";
const Main = () => {
  return (
    <div>
      <Navbar />
      <About />
      <Work />
      <Me />
      <Footer />
    </div>
  );
};

export default Main;
